function numbersonly(myfield,e,dec){var key;var keychar;if(window.event)key=window.event.keyCode;else if(e)key=e.which;else return true;keychar=String.fromCharCode(key);if((key==null)||(key==0)||(key==8)||(key==9)||(key==13)||(key==27))return true;else if((("0123456789").indexOf(keychar)>-1))return true;else if(dec&&(keychar==".")){myfield.form.elements[dec].focus();return false}else return false}


	
function varchk(tgt, ctry) {
    var formvars = ["cn", "em", "pc", "code", "pn", "pt", "apc", "acode", "apn", "apt", "pdt", "sub", "pwd", "cpwd", "ctry", "topic", "date", "cl"];
    for (var i = 0; i < formvars.length; i++) {
        var stat = $(tgt + ' .jform [name="' + formvars[i] + '"]').attr('name') == formvars[i],
            d = new Date(),
            curr_date = d.getDate(),
            curr_month = d.getMonth() + 1,
            curr_year = d.getFullYear(),
            curdat = curr_month + '/' + curr_date + '/' + curr_year;
        if (!stat) {
            if (formvars[i] == "date") $(tgt + ' .jform').append('<input type="hidden" name="' + formvars[i] + '" value="' + curdat + '" />');
            else if (formvars[i] == "cl") $(tgt + ' .jform').append('<input type="hidden" name="' + formvars[i] + '" value="' + ctry + '" />');
            else if (formvars[i] == "topic") $(tgt + ' .jform').append('<input type="hidden" name="' + formvars[i] + '" value="1" />');
            else $(tgt + ' .jform').append('<input type="hidden" name="' + formvars[i] + '" value="1" />')
        }
    }
}
				
				

